import React from "react";
import Carousel from "react-bootstrap/Carousel";
import display from "../Images/apple_shop.png";
import logo_img from "../Images/apple_logo.png";
import 'bootstrap/dist/css/bootstrap.min.css';

const MainBody = () => {
  return (
    <div>
      <Carousel>
        <Carousel.Item>
          <Carousel.Caption>
            <img width={"300px"} src={logo_img} />
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <Carousel.Caption>
            <img width={"300px"} src={display} />
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </div>
  );
};

export default MainBody;
